import React, { Component } from "react";

class worshipperTable extends Component {
  state = { worshippers: [] };
  async componentDidMount() {
    const { data: worshippers } = await getWorshippers();
    this.setState({ service, worshippers });
  }

  render() {
    return (
      <div className="col-m">
        <Maintable
          items={this.state.worshippers}
          toDelete={this.handleDeleteWorshippers}
        />
      </div>
    );
  }
}

export default worshipperTable;
